functions of the EIFSC are to:

   Provide advice, guidance and recommendations on the overall goals of the EIF and on the overall implementation and effectiveness of the EIF programme; 
   Receive and advise on annual progress reports, including progress against the change management plan

strategic plans and the evaluation presented by the EIF Board; ensure transparency of the EIF process;
   Be a forum to share information, experiences and best practices by all the EIF partners and other stakeholders such as the private sector, including on:
   Mainstreaming of trade into national development plans and strategies of EIF Countries;
   Coherence and alignment of donor trade capacity-building programmes with country policies in EIF Countries;
   Mainstreaming of other development concerns into country trade policies, in particular gender equality and environmental sustainability;
   Private sector participation in the EIF processes on the ground; and
   Mechanisms to leverage additional funding of EIF activities
